.
The uniform, characterless agave-based spirit made by diffusers at 1/3 the price of traditional tequila promotes an imitation spirit but without disclosure to consumers, so producers making true, legitimate tequila are challenged with selling alongside imitations at 3x the production cost.
.
We're proud to produce 100% additive-free, non-diffuser tequila that celebrates regional nuances of flavor, traditional production methods and supports its community. Expertly crafted by Master Distiller Enrique Fonseca, our #1146 (pictured) is made from Tequilana Weber Agave grown in the municipio of Atotonlico el Alto and then aged in a variety of barrel types to bring about its unique flavor.
